import React, { useState, useEffect } from 'react';
import './styles.css';

function App() {
  const [state, setState] = useState('Delhi');
  const [weatherData, setWeatherData] = useState(null);
  const [error, setError] = useState('');
  const [forecast, setForecast] = useState({});

  const states = [
    "Delhi", "Mumbai", "Chennai", "Kolkata", "Bengaluru", "Hyderabad", "Ahmedabad", 
    "Pune", "Jaipur", "Surat", "Lucknow", "Kanpur", "Nagpur", "Visakhapatnam", 
    "Bhopal", "Patna", "Ludhiana", "Agra", "Nashik", "Vadodara", "Faridabad", 
    "Meerut", "Rajkot", "Varanasi", "Srinagar", "Aurangabad", "Dhanbad", 
    "Amritsar", "Navi Mumbai", "Allahabad"
  ];

  useEffect(() => {
    handleStateChange({ target: { value: state } });
  }, [state]);

  const handleStateChange = async (event) => {
    const selectedState = event.target.value;
    setState(selectedState);
    setError('');

    try {
      const response = await fetch(`http://localhost:5000/api/weather/${selectedState}`);
      
      if (!response.ok) {
        throw new Error('Failed to fetch weather data. Please try again later.');
      }

      const data = await response.json();
      setWeatherData(data);
    } catch (error) {
      console.error('Error fetching weather data:', error);
      setError(error.message || 'An unknown error occurred');
      setWeatherData(null);
    }
  };

  const handleForecast = async (type) => {
    try {
      const response = await fetch(`http://localhost:5000/api/weather/${state}/${type}`);
      
      if (!response.ok) {
        throw new Error('Failed to fetch weather data. Please try again later.');
      }

      const data = await response.json();
      setForecast({ ...forecast, [type]: data });
    } catch (error) {
      console.error(`Error fetching ${type} weather data:`, error);
      setError(error.message || 'An unknown error occurred');
    }
  };

  return (
    <div className="App">
      <h1 className="dynamic-text">Weather App</h1>
      
      <div>
        <label>Select State: </label>
        <select value={state} onChange={handleStateChange}>
          {states.map((stateName) => (
            <option key={stateName} value={stateName}>
              {stateName}
            </option>
          ))}
        </select>
      </div>
      
      <div>
        <button onClick={() => handleForecast('yesterday')}>Get Yesterday's Weather</button>
        <button onClick={() => handleForecast('tomorrow')}>Get Tomorrow's Weather</button>
      </div>
      
      {error && <p style={{ color: 'red' }}>{error}</p>}
      
      {weatherData && (
        <div className="dynamic-box">
          <h2>Current Weather in {state}</h2>
          <p>Temperature: {weatherData.temperature}°C</p>
          <p>Chance of Rain: {weatherData.chanceOfRain}%</p>
        </div>
      )}
      
      {forecast.yesterday && (
        <div className="dynamic-box">
          <h2>Yesterday's Weather in {state}</h2>
          <p>Temperature: {forecast.yesterday.temperature}°C</p>
          <p>Chance of Rain: {forecast.yesterday.chanceOfRain}%</p>
        </div>
      )}
      
      {forecast.tomorrow && (
        <div className="dynamic-box">
          <h2>Tomorrow's Weather in {state}</h2>
          <p>Temperature: {forecast.tomorrow.temperature}°C</p>
          <p>Chance of Rain: {forecast.tomorrow.chanceOfRain}%</p>
        </div>
      )}
    </div>
  );
}

export default App;
